static const boost::multiprecision::mpz_int m("");//3^2015755

static const boost::multiprecision::mpz_int a("");//3^1007922+9^57319+1


static const boost::multiprecision::mpz_int c("");//224737^91586


static const boost::multiprecision::mpz_int maskone("");//2^2496009


static const boost::multiprecision::mpz_int masktwo("");//2^1697289

static const boost::multiprecision::mpz_int divver("");//2^399361

using namespace std;
using namespace Magick;

#define NUM_THREADS   8
static pthread_mutex_t mutexsum = PTHREAD_MUTEX_INITIALIZER;

Image babel( Geometry(640, 416), Color(MaxRGB, MaxRGB, MaxRGB, 0));

struct thread_data{
	int xcoor;
	int ycoor;
	boost::multiprecision::mpz_int divide;
};

void *quartimg(void *threadarg){
	struct thread_data *my_data;
	my_data = (struct thread_data *) threadarg;
	Image quarter( Geometry(160, 208), Color(MaxRGB, MaxRGB, MaxRGB, 0));
	quarter.magick("JPEG");
	Pixels pixcache(quarter);
	PixelPacket* pixpax;
	pixpax = pixcache.get(0,0,160,208);
	boost::multiprecision::mpz_int color;
	
	for (unsigned x=0;x<33280;x++) {
		color = my_data->divide % 4096;
		*(pixpax++) = Color(piebald[color.convert_to<int>()]);
		my_data->divide =my_data->divide >> 12;
	}

	pixcache.sync();
	pthread_mutex_lock (&mutexsum);
	babel.composite(quarter, my_data->xcoor,my_data->ycoor, OverCompositeOp);
	pthread_mutex_unlock (&mutexsum);
	pthread_exit(NULL);
}

int main() {
	string where;
	
	ifstream ifs("./pointer.txt");
	getline(ifs, where);
	//cout << where << endl;

	boost::multiprecision::mpz_int input(where);
	boost::multiprecision::mpz_int * pointer = &input;
	*pointer = (a*(*pointer)+c)%m;
	
	*pointer ^= (*pointer >> 1098239);
	*pointer ^=((*pointer%maskone) << 698879);
	*pointer ^=((*pointer%masktwo) << 1497599);
	*pointer ^=(*pointer >> 1797118);
	
	pthread_t threads[NUM_THREADS];
	struct thread_data td[NUM_THREADS];
	int rc;
	
	for(int thread=0; thread<NUM_THREADS; thread++){
		td[thread].xcoor=(160*(thread%4));
		td[thread].ycoor=(208*(thread/4));
		td[thread].divide = *pointer % divver;
		*pointer = *pointer >> 399361;
		rc = pthread_create(&threads[thread], NULL, quartimg, (void *)&td[thread]);
	}
	for(int thread=0; thread<NUM_THREADS; thread++) {
		void *status;
		pthread_join(threads[thread],&status);
	}
	
	Blob bablob;
	babel.write(&bablob,"JPEG");
	
	ostringstream streampunk;
	streampunk.write((char*)bablob.data(),bablob.length());

	ofstream writing_file;
	writing_file.open("./outimage.jpg", ios::out);
	writing_file << streampunk.str();
}
